import { Component } from "react";

export default class classComponent extends Component {
  constructor() {
    super();
  }

  addTodo = (event) => {
    var text = this.value;
    console.log(this.value);
  };

  render() {
    return (
      <div>
        <form action="" className="main-container__add-new-item">
          <input
            type="text"
            name="addItem"
            id="addItem"
            placeholder="Add new..."
          />
          <button id="add" onClick={this.addTodo}>
            Add
          </button>
        </form>
      </div>
    );
  }
}
